import React, { Component } from "react";
import "./portfolio.css";
import profilePic from "../../resources/pic/joey.JPG";
import Featured from "../utils/featured";
import ProfileBox from "../utils/profileBox";

class Portfolio extends Component {
  state = {
    porofolio: [
      {
        name: "Wave",
        description:
          "Lorem ipsum dolor sit amet consectetur adipisicing elit. Facere, cum voluptas molestiae qui illum culpa quos maxime fugiat ullam consectetur, reprehenderit modi esse ab. Voluptas tempore molestias dolor quo labore?"
      },
      { name: "Python", width: 80 },
      { name: "React", width: 70 },
      { name: "MongoDB", width: 70 },
      { name: "JavasSript", width: 70 },
      { name: "CSS", width: 70 },
      { name: "NodeJS", width: 70 },
      { name: "Angular", width: 70 }
    ]
  };
  render() {
    return (
      <>
        <Featured>
          <p>My portfolio</p>
        </Featured>
        <ProfileBox />
      </>
    );
  }
}

export default Portfolio;
